import React, { Component } from 'react';
import './TextInput.scss';


const TextInput = (props)=> {

  return(
      <input placeholder={props.placeholder} onChange = {props.onChange} type = "text" name={props.name} className = {`text-input ${props.size === "small" ? 'text-input--small' : null} ${props.border ? 'text-input--border': null} ${props.className}`} />
  )

}

export default TextInput;
